import React from 'react';
import { Link } from 'react-router-dom';

function HomePage() {
  return (
    <div>
      <h1>Welcome to My App</h1>
      <p>
        <Link to="/login">Log in</Link>
      </p>
    </div>
  );
}

export default HomePage;
